 a flexible tool for leveraging the power of Kotlin programming language.Gradle’s Kotlin DSL provides an alternative syntax to the traditional Groovy DSL, along with an improved editing experience in supported IDEs. This includes enhanced content assist, refactoring, documentation, and more.What is BuildSrc?The BuildSrc directory, located in the root of a Gradle project, contains custom build logic written using the Kotlin DSL. With minimal setup requirements, this logic can be shared across the entire project. The following code snippet demonstrates this concept.Create a buildSrc folder and enable Kotlin DSLbuildSrc/build.gradle.ktsimport org.gradle.kotlin.dsl.`kotlin-dsl`

plugins {
    `kotlin-dsl`
}

repositories {
    mavenCentral()
}
buildSrc/src/main/kotlin/Dependencies.ktobject Libs {
   val androidxCamera2 = "androidx.camera:camera-camera2:1.1.0"
}
build.gradledependencies {
    implementation(Dependencies.androidxCamera2)
}
Initially, we were excited and felt like we had found the perfect solution. However, our enthusiasm was short-lived when we discovered a significant trade-off associated with this approach.According to Gradle docsAny changes made to buildSrc will cause the entire project to become out-of-date. As a result, when making small incremental changes, utilising the --no-rebuild command line option can provide faster feedback. However, it is important to run a full build regularly, or at least once development is complete.The prosEliminates the need to rewrite dependencies repeatedly for each moduleEliminates versioning issuesProvides Kotlin supportEliminates the need to learn GroovyOffers navigation supportProvides auto-completion supportThe consAny change to a dependency will trigger recompilation of build scripts and invalidate the Gradle cache, causing rebuilding of more than what is needed for a single version changeIt has poor performance when compared to Groovy scripts, as documented by Gradle, android, and a reported open ticket on GitHubIncreased build timeThe remote Gradle cache also gets invalidatedAutomatic version checks do not work

Eliminates the need to learn GroovyOffers navigation supportProvides auto-completion supportThe consAny change to a dependency will trigger recompilation of build scripts and invalidate the Gradle cache, causing rebuilding of more than what is needed for a single version changeIt has poor performance when compared to Groovy scripts, as documented by Gradle, android, and a reported open ticket on GitHubIncreased build timeThe remote Gradle cache also gets invalidatedAutomatic version checks do not workAnything that affects the build time is a huge concern, so we decided to move forward. However, the decision to use this approach may vary depending on the project. For instance, in a single module project, it might work just fine.*Note: ***There is an open ticket on Github. This has a pull request that proposes changes to make buildSrc work like an implicit plugin included in a build (that is, an included build declared via pluginManagement { includeBuild(x) }). This means that if you choose to use this approach, it's possible that the performance will significantly improve in the future. However, it's up to you to decide whether to proceed with this approach.4) Composite builds and Kotlin DSLThis method uses composite builds to address the issues with the buildSrc approach and assumes that it may take some time before Gradle incorporates the changes to make buildSrc function like an included build.In this method, we create custom plugins that define dependencies, and then we apply these custom plugins in the settings.gradle file for use in the build. i.e we move our logic from buildSrc into a separate plugins module and add includeBuild(“plugins”) within settings.gradle. Voila!plugins/src/dependencies.ktclass Dependencies : Plugin<Project> {
  override fun apply(project: Project)
    {
     companion object
        {
          val androidxCamera2 = "androidx.camera:camera-camera2:1.1.0"
        }
    }
}
settings.gradleincludeBuild("plugins")
