The prosAvoids the need to rewrite dependencies repeatedly for each moduleNo need to have a deep understanding of GroovySupport for Kotlin DSLChanges do not invalidate the Gradle cacheNavigation support for easy code browsingAuto-completion support for faster developmentThe consThere is no standardised approach for achieving thisThe setup process is more complex than other approachesAutomatic version checks do not work with thisIt has poor performance when compared to Groovy scripts. Since most documents mention this, you can refer to the following links - gradle, android, and an open ticket on GitHub.You can read more about composite builds here.5) Version CatalogFinally, we came across the solution we were looking for - Version Catalog by Gradle.Gradle's Version Catalog, introduced in version 7.0, is a powerful tool for managing dependencies across multiple projects. It provides a centralised list of type-safe dependencies to be used across projects. The Version Catalog is flexible and customisable. Overall, the Version Catalog is a valuable addition to the Gradle toolchain and worth exploring for better dependency management.https://i.embed.ly/1/display/resize?url=https%3A%2F%2Fi.giphy.com%2Fmedia%2F1ym5LJ17vp77BL8X5O%2Fgiphy.gif&key=a19fcc184b9711e1b4764040d3dc5c07The Version Catalog is a file added to the Gradle folder in the root directory of your project, using the TOML configuration format. While there are other ways to declare dependencies in Gradle without using the TOML file, using the Version Catalog with a TOML file can help to centralise and simplify your dependency management.The TOML file will look something like this.gradle/libs.versions.toml[versions]
androidxActivity = "1.6.1"
androidxCamera = "1.1.0"
androidxCompose-runtime = "1.3.1"
